          <Applicant/>
        </Route>
        <Route path= "/reviewer">
          <Reviewer/>
        </Route>
        <Route path= "/reclutar">
          <Reclutador/>
        </Route>
        <Route path="/AdminSystem/:id">
          <AdminSystem />
        </Route>
        <Route path="/AdminUser">
          <AdminUser/>
        </Route>
        <Route path="/">
          <Guest/>
        </Route>
      </Switch>
    </Router>

  );
}

export default App;
